import Button from 'react-bootstrap/Button'
import {useNavigate} from "react-router-dom"

const  Home=()=>{

  const navigate = useNavigate();

  const src="https://www.nextre.it/wp-content/uploads/2018/04/ecommercedata.jpg"

  const style={
    minHeight:"925px",  
    width:"100%",
    backgroundImage: `url(${src})`,
    backgroundRepeat:"no-repeat",
    backgroundPosition: "center",
  }

    return <div style={style}>

      <Button variant="primary" onClick={()=>navigate("/products")}>Products</Button>

    </div>
}

export default Home;
